INSERT INTO `event` VALUES (1,'Vietnam Trail Marathon 2021','2021-04-24 00:00:00','Mộc Châu','Trải nghiệm Vietnam Trail Marathon và khám phá những cung đường mòn nguyên sơ, chinh phục xa hơn những con đường cũ cùng chúng tôi.',0,1,'2021-05-28 11:06:30','2021-05-28 11:06:30','vietnam-trail-marathon-2021'),(2,'Ecopark Marathon 2021','2021-04-10 00:00:00','Khu đô thị Ecopark','Nổi bật với cung đường bao quanh bởi màu xanh mướt của trăm ngàn cây cỏ, uốn lượn theo hồ nước mát lành, xuyên giữa thiên nhiên thoáng đạt, EPM đã tạo nên thương hiệu chạy giữa miền xanh thu hút sự quan tâm và ủng hộ của cộng đồng yêu chạy bộ, các gia đình và doanh nghiệp.\nECOPARK MARATHON tổ chức định kỳ mỗi năm một lần vào đúng dịp Giỗ tổ Hùng Vương mang đến những trải nghiệm vô cùng thú vị và độc đáo.',0,1,'2021-05-28 11:08:46','2021-05-28 11:08:46','ecopark-marathon-2021'),(3,'Techcombank Marathon 2021','2021-03-28 00:00:00','Hà Nội','Thành phố Hà Nội, thủ đô duy nhất của đất nước Việt Nam, sẽ được giới thiệu đến những người đam mê thể thao trong nước và quốc tế thông qua Giải Hà Nội Marathon Techcombank lần đầu tiên.\n\nSự kiện sẽ bắt đầu với “Phố Marathon”, nơi diễn ra hàng loạt các hoạt động vui chơi giải trí và trải nghiệm dành cho cộng đồng thể thao cũng như mọi thành viên trong gia đình bao gồm các khu hội chợ sôi động với nhiều gian hàng thể thao đa dạng, trình diễn nhạc sống, đặc biệt, các buổi chia sẻ chuyên sâu về dinh dưỡng, kỹ thuật tập luyện marathon. ',0,2,'2021-05-28 11:09:13','2021-05-28 11:09:13','techcombank-marathon-2021'),(4,'Tien Phong Marathon 2021','2021-03-28 00:00:00','Pleiku, Gia Lai','Giải vô địch quốc gia Marathon và cự ly dài báo Tiền Phong (Tiền Phong Marathon) là giải đấu đỉnh cao có tuổi đời lâu nhất trong làng thể thao Việt Nam, được tổ chức lần đầu tiên vào năm 1958 tại Hà Nội. Đây là một giải đấu hàng đầu, đã được đưa vào hệ thống thi đấu của điền kinh Việt Nam trong suốt nửa thế kỷ qua, được tổ chức cuối tháng 3 hằng năm.\n\nTiền Phong Marathon quy tụ những VĐV xuất sắc nhất của điền kinh Việt Nam ở các cự ly trung bình và dài tranh tài giành huy chương quốc gia, cũng là cơ hội để các VĐV phong trào tranh tài trên cùng một đường đua với các VĐV hàng đầu quốc gia.',0,1,'2021-05-28 11:09:37','2021-05-28 11:09:37','tien-phong-marathon-2021');
/*!40000 ALTER TABLE `event` ENABLE KEYS */;
